import React, { Component } from "react";

class Menu extends Component {

    state = {
        page: 'main'
    }

    chois(page, chois){
        switch (chois) {
            case 'main':
                return page;
            case 'about':
                return page.chois;
            default:
                page;
        }
    }
    
    render(){
    return(
            <div className="menu-block">
                    <div className="menu-item"
                    id="main"
                    onClick={() => this.handleClick()}>
                        Главная
                    </div>
                    <div className="menu-item"
                    id="about"
                    onClick={() => this.handleClick()}>
                        О продуктах
                    </div>
                    <div className="menu-item"
                    onClick={() => this.handleClick()}>
                        Выйти
                    </div>
            </div>
    )
}
}

export default Menu
